{"desc":"An introduction to the methods and attitudes of mathematical modeling. Because modeling in physical science and engineering is already taught in courses in those disciplines, applications in this course will be primarily to social and biological sciences. Various standard methods used in modeling will be introduced: differential equations, Markov chains, game theory, graph theory, and computer simulation. The emphasis, however, will be on how to apply these subjects to specific modeling problems, not on their systematic theory. The format of the course will include projects as well as lectures and problem sets. Prerequisites: Linear algebra and several-variable calculus or permission of the instructor. 1.000 Credit hours","url":"https://myswat.swarthmore.edu/pls/bwckctlg.p_disp_listcrse?term_in=201504&subj_in=MATH&crse_in=056&schd_in=%25","host":"swarthmore.edu","termId":"201504","subject":"MATH","classId":"056","name":"Modeling","lastUpdateTime":1440450982303,"deps":{"EllucianSectionParser":["Lp5x3te5r4n4aV38"]},"prereqs":{"type":"and","values":[{"type":"or","values":["https://myswat.swarthmore.edu/pls/bwckctlg.p_disp_listcrse?term_in=201504&subj_in=MATH&crse_in=027&schd_in=%25","https://myswat.swarthmore.edu/pls/bwckctlg.p_disp_listcrse?term_in=201504&subj_in=MATH&crse_in=028&schd_in=%25","https://myswat.swarthmore.edu/pls/bwckctlg.p_disp_listcrse?term_in=201504&subj_in=MATH&crse_in=028S&schd_in=%25","Pre-req for Math 056 1"]},{"type":"or","values":["https://myswat.swarthmore.edu/pls/bwckctlg.p_disp_listcrse?term_in=201504&subj_in=MATH&crse_in=033&schd_in=%25","https://myswat.swarthmore.edu/pls/bwckctlg.p_disp_listcrse?term_in=201504&subj_in=MATH&crse_in=034&schd_in=%25","https://myswat.swarthmore.edu/pls/bwckctlg.p_disp_listcrse?term_in=201504&subj_in=MATH&crse_in=035&schd_in=%25","Pre-req for Math 056 1"]}]},"_id":"z7dhZTHs2AaML5xs"},
